    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 + - col2 NOT BETWEEN ( col0 * col2 + - col0 + + + 51 ) AND - 4 + col1;
  - name: tab0

outputs:
